import React from 'react'
import defaultImage from './logo.svg';
import { DataGrid } from '@mui/x-data-grid';

const Results = (props) => {
  const {path,output,closeModel,processimage,outoutState}=props
  console.log(path+"   "+output)
  function onclickfun(){
    outoutState([])
    processimage(defaultImage)
    closeModel(false);
  }
  return (
    <div>
      <img src={path}></img>
      <DataGrid
  rows={['a','b']}
  columns={3}
/>
      <button onClick={onclickfun}></button>
    </div>
  );
};

export default Results;
